import React from "react";

function About() {
  return (
    <div className="pageCard row">
      <div className="divHeightHalf pb-2 col-12 col-md-4 order-md-2">
        <img
          className="petImgHeightHalf"
          src="http://placeimg.com/1920/1080/animals"
        ></img>
      </div>
      <div className="divHeightHalf pb-2 col-12 col-md-8 order-md-1">
        <h4>Pet Friend.ly</h4>
        <h5>is a social network for pet lovers.</h5>
        <p>
          Here you can find a lot of content about pets, find friends with
          commom interests and even addopt a pet.
        </p>
      </div>
    </div>
  );
}

export default About;
